    fontFamily: "Roboto, sans-serif",
    fontWeight: 600,
    color: "#FFFEFE",
    textAlign: "left",
  },
}));

export default function Header() {
  const displayDesktop = () => {
    return <Toolbar>{triviaLogo}</Toolbar>;
